import React from 'react'
import './index.sass'
import './vegetable.jpg'


class Nav extends React.Component {

    handleOnLogout =event => {
        event.preventDefault()

        this.props.onLogout()
    }

    handleEditProfile =event => {
        event.preventDefault()

        this.props.editProfile()
    }

    handleOnInputs =()=>{
        this.props.editInputs()
    }


    render() {
        return <nav className="navbar">
                <img src='https://www.google.com/imgres?imgurl=https%3A%2F%2Fnews.nationalgeographic.com%2Fcontent%2Fdam%2Fnews%2F2018%2F05%2F17%2Fyou-can-train-your-cat%2F02-cat-training-NationalGeographic_1484324.ngsversion.1526587209178.adapt.1900.1.jpg&imgrefurl=https%3A%2F%2Fnews.nationalgeographic.com%2F2018%2F05%2Fanimals-cats-training-pets%2F&docid=akVgzlixzomdsM&tbnid=Sx42zOsahzEQ-M%3A&vet=10ahUKEwiruq7J-angAhVUShUIHe8ICjQQMwg3KAAwAA..i&w=1900&h=1266&bih=617&biw=1280&q=cat&ved=0ahUKEwiruq7J-angAhVUShUIHe8ICjQQMwg3KAAwAA&iact=mrc&uact=8' alt='logo' className="navbar-brand" ></img>
                {this.props.results && <button className="btn btn-outline-light inline inputs pb-2 pt-2" onClick={this.handleOnInputs}>Back to Inputs</button>}
                <button className="navbar-toggler btn btn-dark active p-3" type="button" data-toggle="collapse" data-target="#navbarText" aria-controls="navbarText" aria-expanded="false" aria-label="Toggle navigation">
                    {JSON.parse(sessionStorage.getItem('user')).name}
                </button>
                <div className="collapse navbar-collapse" id="navbarText">
                    <ul className="navbar-nav mt-3">
                        <li className="nav-item ">
                            <a  onClick={this.handleEditProfile} className="nav-link text-right nav__link" href="#">Edit Profile </a>
                        </li>
                        <li className="nav-item">
                            <a onClick={this.handleOnLogout} className="nav-link text-right nav__link" href="#">Logout</a>
                        </li>
                    </ul>
                </div>
            </nav>

    }
}

export default Nav
